using System;\nusing System.Collections.Generic;\nusing System.Linq;\n\nclass Program\n{\n    static void Main()\n    {\n        var items = new List<Item>\n        {\n            new Item { something = 5 },\n            new Item { something = 15 },\n            new Item { something = 20 }\n        };\n\n        var otherList = new List<Item>();\n\n        // Use HashSet for faster lookup\n        var selectedSet = new HashSet<Item>(items.Where(item => item.something > 10));\n\n        otherList.AddRange(selectedSet);\n\n        items.RemoveAll(selectedSet.Contains);\n    }\n}\n\nclass Item\n{\n    public int something { get; set; }\n}